import React from 'react'
import {useHistory} from 'react-router-dom'

export default function Home() {
    
    let history = useHistory();

    var LogReg = () => {
        history.push("/signup")
    }

    var showUser = () => {
        history.push("/users")
    }

    
    return (

        <div style = {{display: 'grid' , placeItems : 'center'}}>
            <div style = {{paddingTop: '20%', fontSize: '50px'}}>Inital home Screen</div>
            <button style = {{padding: '1%', background: 'lightblue'}} onClick = {LogReg}>Login \ Register</button>
            <button style = {{padding: '1%', background: 'lightblue'}} onClick = {showUser}>User</button>

        
        </div>
    )
}
